  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The VICP website has 3 Tables. The first
  Table is the \"Statistics Report,\" which details by fiscal year the number of petitions
  filed, the number of adjudications (Court judgments), and the number and amounts
  of compensation awards.  The second Table is the \"Claims Filed and Dismissed by
  Vaccine,\" which details the number and status of claims by vaccine type.  The third
  Table is the \"Adjudication Categories by Vaccine,\" which details the number of
  concessions by HRSA, the number of Court Decisions, and the number of settlements
  for compensated claims, along with the number of dismissals, all by vaccine type.
  \ This Table additionally provides CDC-supplied data on the number of doses distributed
  in the U.S. by vaccine type.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
